import React, { useEffect, useState } from 'react';
import axios from 'axios';
import {
  Container,
  Typography,
  Grid,
  Card,
  CardContent,
  Box,
  IconButton,
  Divider,
  Paper
} from '@mui/material';
import DeleteIcon from '@mui/icons-material/Delete';
import SchoolIcon from '@mui/icons-material/School';
import AddExamForm from '../components/AddExamForm';
import ExamChart from '../charts/ExamChart';

const ExamPage = ({ searchTerm }) => {
  const [exams, setExams] = useState([]);

  const recommendedExams = [
    'UPSC CSE', 'SSC CGL', 'IBPS PO', 'SBI PO', 'RRB NTPC',
    'CDS', 'NDA', 'AFCAT', 'CAPF', 'IFS',
    'GATE', 'ISRO Scientist', 'DRDO CEPTAM', 'UGC NET', 'CSIR NET',
    'CAT', 'XAT', 'IIFT', 'MAT', 'CLAT',
    'AILET', 'NEET', 'JEE Main', 'JEE Advanced', 'AIIMS',
    'JIPMER', 'BITSAT', 'NIFT', 'NID', 'State PSCs'
  ];

  const fetchExams = () => {
    axios.get('http://localhost:5000/api/exams')
      .then(res => setExams(res.data))
      .catch(err => console.error(err));
  };

  const handleDelete = async (id) => {
    try {
      await axios.delete(`http://localhost:5000/api/exams/${id}`);
      fetchExams();
    } catch (err) {
      console.error('Error deleting exam:', err);
    }
  };

  useEffect(() => {
    fetchExams();
  }, []);

  const filteredExams = exams.filter((exam) =>
    exam.name.toLowerCase().includes(searchTerm.toLowerCase())
  );

  return (
    <Container sx={{ mt: 4 }}>
      {/* Page Title with Icon */}
      <Typography
        variant="h4"
        gutterBottom
        sx={{ fontWeight: 'bold', display: 'flex', alignItems: 'center' }}
      >
        <SchoolIcon sx={{ mr: 1, fontSize: 32 }} />
        Competitive Exams Hub
      </Typography>

      {/* Add Exam Form */}
      <Box sx={{ mb: 4 }}>
        <AddExamForm onExamAdded={fetchExams} />
      </Box>

      {/* Recommended Exams Section */}
      <Box sx={{ my: 5 }}>
        <Typography variant="h5" fontWeight="bold" gutterBottom>
          🎯 Top 30 Competitive Exams in India
        </Typography>
        <Paper elevation={2} sx={{ p: 3, backgroundColor: '#f9f9f9' }}>
          <Grid container spacing={2}>
            {recommendedExams.map((exam, index) => (
              <Grid item xs={12} sm={6} md={4} key={index}>
                <Card elevation={1} sx={{ p: 2 }}>
                  <Typography variant="body1" fontWeight={500}>
                    {exam}
                  </Typography>
                </Card>
              </Grid>
            ))}
          </Grid>
        </Paper>
      </Box>

      {/* Divider */}
      <Divider sx={{ my: 4 }} />

      {/* User Added Exams */}
      <Typography variant="h5" fontWeight="bold" gutterBottom>
        📝 Your Added Exams
      </Typography>
      <Grid container spacing={2}>
        {filteredExams.map((exam) => (
          <Grid item xs={12} sm={6} md={4} key={exam.id}>
            <Card elevation={3}>
              <CardContent>
                <Box
                  sx={{
                    display: 'flex',
                    justifyContent: 'space-between',
                    alignItems: 'center'
                  }}
                >
                  <Box>
                    <Typography variant="h6" sx={{ fontWeight: 600 }}>
                      {exam.name}
                    </Typography>
                    <Typography variant="body2" color="text.secondary">
                      {exam.description}
                    </Typography>
                  </Box>
                  <IconButton
                    color="error"
                    onClick={() => handleDelete(exam.id)}
                  >
                    <DeleteIcon />
                  </IconButton>
                </Box>
              </CardContent>
            </Card>
          </Grid>
        ))}
      </Grid>

      {/* Chart Section */}
      <Box sx={{ mt: 5 }}>
        <ExamChart />
      </Box>
    </Container>
  );
};

export default ExamPage;
